import React from 'react';
import { Routes, Route } from 'react-router-dom'
import './App.css';
import Home from './pages/Home';
import View from './pages/View';

function App() {
  return (
      <div className="App">
        <Routes>
          <Route path='/' element={<Home/>}/>
          <Route path='/view' element={<View/>}/>
        </Routes>
      </div>
  );
}

export default App;
